--键盘按键
local keymap = {
    [49] = "1", [50] = "2", [51] = "3", [52] = "4", [53] = "5", [54] = "6", [55] = "7", [56] = "8", [57] = "9", [48] = "0", [37] = "%", [63] = "?", [33] = "!", [44] = ",", [46] = ".", [64] = "@",
}
--解析输入
local function analyze(input, keycode)
    local pattern = "[0-9%%%?!,%.@]"
    local found = string.find(input, pattern)
    if (found ~= nil) then
        local substr = input:sub(found)
        local last = ""
        if (#substr ~= 2) then
            last = substr:sub(3)
            substr = substr:sub(1, 2)
        end
        if (#substr == 2) then
            local str = keymap[keycode]
            if (str == nil) then
                return input
            end
            --查询结果
            local res = cases[substr .. str]
            if (res == nil) then
                return input
            end
            return input:sub(1, found - 1) .. res .. last
        end
    end
    return input
end
---
---初始化
---@param env object 上下文对象
---
local function init(env)
    
end

---
---初始化
---@param key_event table 按键对象
---@param env table 上下文对象
---
local function processor(key_event, env)
    local engine = env.engine
    local context = engine.context
    local input = context.input
	
	--解析编码
	local res = analyze(input, key_event.keycode)
	if (res ~= nil and res ~= input) then
		local found = string.find(res, " ")
		if (found ~= nil) then
			context.input = res:sub(1, #input - 2)
			return 1
		else
			context.input = res
			return 1
		end
	end
	
	-- Enter
    if (key_event.keycode == 65293) then
		if (context.caret_pos ~= #input) then
            context.caret_pos = #input
            return 1
		elseif (#input > 0 and context.caret_pos == #input) then
			context:clear_previous_segment()
			context:clear()
			return 1
        end
    end

    return 2
end

return { init = init, func = processor }
